import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 className='App-title'>Welcome to react</h1>
      </header>
      <Page1/>
      <Page2/>
      <Page/>
    </div>
  );
}

export default App;
